" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 488px\">",
"   <div class=\"ttl\">",
"    Planimetry of the left atrium for volume calculation from the apical 2 chamber (long axis) view",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 468px; height: 225px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panel A is schematic of the structures imaged from the apical two-chamber view and panel B is the actual echocardiogram. The apical two-chamber view at end-systole is used for a computer-generated planimetric tracing from which both single and biplane atrial volumes can be obtained (panel C). A biplane volume estimation, combining the two- and four-chamber planimetric information, is preferred.",
"    <div class=\"footnotes\">",
"     LV: left ventricle; LA: left atrium; mv: mitral valve; pv: pulmonic valve; R: right; L: left; A: apex; B: base.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
