" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 488px\">",
"   <div class=\"ttl\">",
"    Pneumothorax",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 468px; height: 422px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This posterior-anterior (PA) radiograph of the chest reveals a left pneumothorax. The lateral border of the lung (white arrows) no longer lies adjacent to the chest wall and the lung parynchema is contracted accounting for the lung's abnormal appearance. Note the air and absence of lung markings along the left lateral border of the heart (arrow heads) and the inferior and medial displacement of the left mainstem bronchus. The border of the scapula (black arrows) is sometimes mistaken for a pneumothorax.",
"    <div class=\"footnotes\">",
"    </div>",
