" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Ingrown toenail",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 338px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The nail plate is entering the lateral nail groove, causing erythema, granulation tissue, and discomfort.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Stedman's Medical Dictionary. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pincer nails deformity",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 278px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Transverse overcurvature of the nail is seen in pincer nail deformity. The disorder may be hereditary or acquired. In cases of acquired pincer nails, poorly fitting shoes are often responsible. The condition can be painful.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Goodheart HP. Goodheart's Photoguide of Common Skin Disorders, 2nd ed, Lippincott Williams &amp; Wilkins, Philadelphia 2003. Copyright &copy; 2003 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pincer nails deformity",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 265px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Transverse overcurvature of the nail is seen in pincer nail deformity. The disorder may be hereditary or acquired. In cases of acquired pincer nails, poorly fitting shoes are often responsible. The condition can be painful.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
