var title_f3_4_3149="Clinical features of immunodeficiency disorders";
var content_f3_4_3149=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F74045&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F74045&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical features of primary immunodeficiency disorders",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Adaptive immunity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        B-cell defects:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Recurrent bacterial sinopulmonary infections or sepsis, particularly with polysaccharide encapsulated organisms (S. pneumoniae, H. influenzae type b)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Unexplained bronchiectasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chronic or recurrent gastroenteritis (often with Giardia or enterovirus)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Failure to thrive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chronic enteroviral meningoencephalitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Arthritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        T-cell defects:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Recurrent, severe, or unusual viral infections (varicella-zoster, CMV, HSV)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Failure to thrive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chronic candidiasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chronic diarrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lymphopenia during the neonatal period or in infancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pneumocystis pneumonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Graft-versus-host disease (maculopapular and/or desquamating skin, abnormal liver function tests and/or chronic diarrhea)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Severe/neonatal eczematoid or seborrheic rashes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Innate immunity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Phagocytic defects:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Poor wound healing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Delayed separation of the umbilical cord",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lymphadenitis or soft tissue abscesses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hepatosplenomegaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chronic gingivitis and periodontal disease; oral mucosal ulcerations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Infection with catalase positive bacteria and fungi",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Recurrent gastrointestinal or genitourinary tract obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Complement defects:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Angioedema of face, hands, feet, GI tract",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Autoimmune disease; lupus-like symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pyogenic bacterial infections (eg, N. meningitidis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        History suggestive of autosomal dominant inheritance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Other defects:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Herpes simplex meningoencephalitis in infancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Papilloma virus infections of skin, including extensive warts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ectodermal dysplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pyogenic infections (eg, sepsis, meningitis)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
