var title_f3_4_3150="Water shifts hemofiltration";
var content_f3_4_3150=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F76802&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F76802&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Water movement during isolated ultrafiltration",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 207px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic representation of water movement during isolated ultrafiltration. Plasma at an osmolality of 320 mosmol/kg flows into the dialyzer (filter) (step 1) which is not perfused with dialysate. The favorable hydrostatic pressure gradient results in the",
"    <span style=\"font-weight:bold\">",
"     isosmotic",
"    </span>",
"    removal of fluid in the dialyzer. The fluid returning to the patient is reduced in volume but not changed in osmolality (step 2). The ensuing rise in plasma oncotic pressure results in fluid movement from the interstitial fluid and the cells into the vascular space (step 3). This last effect will tend to minimize the degree of plasma volume depletion and protect against the development of hypotension.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
